import { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';

function ListerListings() {
  const { user } = useAuth();
  const [listings, setListings] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchListings = async () => {
      try {
        const token = localStorage.getItem('token');
        console.log('Fetching listings for user:', user?.username);

        if (!user?.username) {
          throw new Error('No username available');
        }

        const response = await fetch(`http://localhost:5001/api/listers/listers/${user.username}/listings`, {
          headers: {
            'Authorization': `Bearer ${token}`
          }
        });

        const data = await response.json();
        console.log('Received listings data:', data);

        if (!response.ok) {
          throw new Error(data.message || 'Failed to fetch listings');
        }

        setListings(Array.isArray(data.listings) ? data.listings : []);
        setError(null);
      } catch (err) {
        console.error('Error fetching listings:', err);
        setError(err.message || 'Error fetching listings. Please try again.');
      } finally {
        setLoading(false);
      }
    };

    if (user?.username) {
      fetchListings();
    }
  }, [user?.username]);

  const handleDeleteListing = async (listingId) => {
    try {
      const token = localStorage.getItem('token');
      const response = await fetch(`http://localhost:5001/api/listers/${user.username}/listings/${listingId}`, {
        method: 'DELETE',
        headers: {
          'Authorization': `Bearer ${token}`
        }
      });

      if (!response.ok) {
        throw new Error('Failed to delete listing');
      }

      // Remove the deleted listing from state
      setListings(listings.filter(listing => listing._id !== listingId));
    } catch (err) {
      console.error('Error deleting listing:', err);
      setError('Failed to delete listing');
    }
  };

  if (loading) {
    return (
      <div className="min-h-screen bg-gray-50 flex items-center justify-center">
        <div className="text-gray-600">Loading...</div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="min-h-screen bg-gray-50 flex items-center justify-center">
        <div className="text-red-600">{error}</div>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-gray-50 py-12">
      <div className="container mx-auto px-4 max-w-6xl">
        <div className="bg-white rounded-2xl shadow-xl p-8">
          <div className="flex justify-between items-center mb-8">
            <h1 className="text-2xl font-bold text-gray-800">Your Listings</h1>
            <Link
              to="/listings/new"
              className="bg-blue-600 text-white px-4 py-2 rounded-lg hover:bg-blue-700 transition-colors"
            >
              Add New Listing
            </Link>
          </div>

          {error ? (
            <div className="text-center py-12">
              <p className="text-red-600 mb-4">{error}</p>
            </div>
          ) : listings.length === 0 ? (
            <div className="text-center py-12">
              <p className="text-gray-600 mb-4">You haven't created any listings yet.</p>
              <Link
                to="/listings/new"
                className="text-blue-600 hover:text-blue-800 font-medium"
              >
                Create your first listing
              </Link>
            </div>
          ) : (
            <div className="grid grid-cols-1 gap-6">
              {listings.map((listing, index) => (
                <div
                  key={listing._id || index}
                  className="border rounded-lg p-6 hover:shadow-md transition-shadow"
                >
                  <div className="flex justify-between items-start">
                    <div className="space-y-2">
                      <h2 className="text-xl font-semibold">${listing.rent}/month</h2>
                      <p className="text-gray-600">
                        {listing.numberOfRooms} rooms • {listing.numberOfBathrooms} baths • {listing.squareFoot} sq ft
                      </p>
                      <p className="text-gray-600">
                        {listing.distanceFromUniv} miles from university
                      </p>
                      <p className="text-gray-700">{listing.description}</p>
                    </div>
                    <div className="flex space-x-4">
                      <Link
                        to={`/listings/${listing._id}/edit`}
                        className="text-blue-600 hover:text-blue-800"
                      >
                        Edit
                      </Link>
                      <button
                        onClick={() => handleDeleteListing(listing._id)}
                        className="text-red-600 hover:text-red-800"
                      >
                        Delete
                      </button>
                    </div>
                  </div>
                </div>
              ))}
            </div>
          )}
        </div>
      </div>
    </div>
  );
}

export default ListerListings;
